s and services (e.g. Grafana, Prometheus, Splunk) is a plus</p><p>• Experience using Docker and container orchestration, such as Kubernetes is a plus</p><p>• Familiar with Cloud as Azure or AWS is a plus</p><p><br></p><p>Why You\'ll Love Working Here</p><p><br></p><p>Why BOSCH?</p><p><br></p><p>Because we don\'t just follow trends, we create them.</p><p><br></p><p>Because together we turn ideas into reality, working every day to make the world of tomorrow a better place. Do you have high standards when it comes to your job? So do we. At Bosch, you will discover more than just work.</p><p><br></p><p>Benefits and Career Opportunities</p><p>• Working in one of the Best Places to Work in Vietnam</p><p>• Join a dynamic and fast growing global company (English-speaking environment)</p><p>• 13th-month salary bonus + attractive performance bonus (you\'ll love it!) + annual performance appraisal</p><p>• 100% monthly basic salary and mandatory social insurances in 2-month probation</p><p>• Onsite opportunities: short-term and long-term assignments</p><p>• 15++ days of annual leave + 1 day of birthday leave</p><p>• Premium health insurance for employee and 02 family members</p><p>• Flexible working time</p><p>• Lunch and parking allowance</p><p>• Various training on hot-trend technologies/ foreign language (English/Chinese/Japanese) and soft-skills</p><p>• Fitness &amp; sport activities: football, badminton, yoga, Aerobic</p><p>• Free in-house entertainment facilities and snack</p><p>• Join in various team building, company trip, year-end party, tech talks and a lot of charity events</p>','Senior Intern DevOps Engineer CI/CD','Senior Intern DevOps Engineer CI/CD','string','string',NULL,NULL,'string','string',4,450);
